      out.write("\t\t<div class=\"person_info_agree mt30\">\r\n");
      out.write("\t\t\t<span class=\"star\">개인정보 수집 및 이용 동의</span>\r\n");
      out.write("\t\t\t<p style=\"line-height: 23px\">\r\n");
      out.write("\t\t\t\tinus 서비스센터 개인정보 취급방침<br>\r\n");
      out.write("\t\t\t\t<br>\r\n");
      out.write("\t\t\t\t<inus 서비스센터>('http://cs.inusbath.com'이하 'inus 서비스센터\r\n");
      out.write("\t\t\t\t홈페이지')은(는) 개인정보보호법에 따라 이용자의 개인정보 보호 및 권익을 보호하고 개인정보와 관련한 이용자의 고충을\r\n");
      out.write("\t\t\t\t원활하게 처리할 수 있도록 다음과 같은 처리방침을 두고 있습니다.<br>\r\n");
      out.write("\t\t\t\t<br>\r\n");
      out.write("\t\t\t\t<inus 서비스센터>('inus 서비스센터 홈페이지') 은(는) 회사는 개인정보처리방침을 개정하는 경우\r\n");
      out.write("\t\t\t\t웹사이트 공지사항(또는 개별공지)을 통하여 공지할 것입니다.<br>\r\n");
      out.write("\t\t\t\t<br>\r\n");
      out.write("\t\t\t\t○ 본 방침은부터 2017년 10월 1일부터 시행됩니다.<br>\r\n");
      out.write("\t\t\t\t<br>\r\n");
      out.write("\t\t\t\t개인정보의 처리 목적 <inus 서비스센터>('http://cs.inusbath.com'이하 'inus\r\n");
      out.write("\t\t\t\t서비스센터 홈페이지')은(는) 개인정보를 다음의 목적을 위해 처리합니다. 처리한 개인정보는 다음의 목적 이외의 용도로는\r\n");
      out.write("\t\t\t\t사용되지 않으며 이용 목적이 변경될 시에는 사전동의를 구할 예정입니다.<br>\r\n");
      out.write("\t\t\t\t가. 홈페이지 회원가입 및 관리<br>\r\n");
      out.write("\t\t\t\t고충처리, 분쟁 조정을 위한 기록 보존 등을 목적으로 개인정보를 처리합니다.<br>\r\n");
      out.write("\t\t\t\t나. 민원사무 처리<br>\r\n");
      out.write("\t\t\t\t민원인의 신원 확인, 민원사항 확인, 사실조사를 위한 연락·통지, 처리결과 통보 등을 목적으로 개인정보를 처리합니다.<br>\r\n");
      out.write("\t\t\t\t다. 재화 또는 서비스 제공<br>\r\n");
      out.write("\t\t\t\t서비스 제공, 본인인증 등을 목적으로 개인정보를 처리합니다.<br>\r\n");
      out.write("\t\t\t\t<br>\r\n");
      out.write("\t\t\t\t2. 개인정보 파일 현황<br>\r\n");
      out.write("\t\t\t\t1. 개인정보 파일명 : 개인정보 수집 파일 현황<br>\r\n");
      out.write("\t\t\t\t- 개인정보 항목 :이메일, 휴대전화번호, 비밀번호, 이름, 접속 로그, 쿠키<br>\r\n");
      out.write("\t\t\t\t- 수집방법 : 홈페이지, 서면양식, 전화/팩스<br>\r\n");
      out.write("\t\t\t\t- 보유근거 : 개인정보취급 방침<br>\r\n");
      out.write("\t\t\t\t- 보유기간 : 3년<br>\r\n");
      out.write("\t\t\t\t- 관련법령 :소비자의 불만 또는 분쟁처리에 관한 기록 : 3년(전자상거래등에서의 소비자보호에 관한 법률) <br>\r\n");
      out.write("\t\t\t\t<br>\r\n");
      out.write("\t\t\t\t3. 개인정보처리 위탁<br>\r\n");
      out.write("\t\t\t\t① <inus 서비스센터>('inus 서비스센터 홈페이지')은(는) 원활한 개인정보 업무처리를 위하여 다음과\r\n");
      out.write("\t\t\t\t같이 개인정보 처리업무를 위탁하고 있습니다.<br>\r\n");
      out.write("\t\t\t\t② <inus 서비스센터>('http://cs.inusbath.com'이하 'inus 서비스센터\r\n");
      out.write("\t\t\t\t홈페이지')은(는) 위탁계약 체결 시 개인정보 보호법 제25조에 따라 위탁업무 수행목적 외 개인정보 처리금지,\r\n");
      out.write("\t\t\t\t기술적․관리적 보호조치, 재위탁 제한, 수탁자에 대한 관리․감독, 손해배상 등 책임에 관한 사항을 계약서 등 문서에\r\n");
      out.write("\t\t\t\t명시하고, 수탁자가 개인정보를 안전하게 처리하는지를 감독하고 있습니다.<br>\r\n");
      out.write("\t\t\t\t③ 위탁업무의 내용이나 수탁자가 변경될 경우에는 지체 없이 본 개인정보 처리방침을 통하여 공개하도록 하겠습니다.<br>\r\n");
      out.write("\t\t\t\t<br>\r\n");
      out.write("\t\t\t\t4.정보주체의 권리,의무 및 그 행사방법 이용자는 개인정보주체로서 다음과 같은 권리를 행사할 수 있습니다.<br>\r\n");
      out.write("\t\t\t\t① 정보주체는 inus 서비스센터(‘http://cs.inusbath.com’이하 ‘inus 서비스센터 홈페이지) 에\r\n");
      out.write("\t\t\t\t대해 언제든지 다음 각 호의 개인정보 보호 관련 권리를 행사할 수 있습니다.<br>\r\n");
      out.write("\t\t\t\t1. 개인정보 열람요구<br>\r\n");
      out.write("\t\t\t\t2. 오류 등이 있을 경우 정정 요구<br>\r\n");
      out.write("\t\t\t\t3. 삭제요구<br>\r\n");
      out.write("\t\t\t\t4. 처리정지 요구<br>\r\n");
      out.write("\t\t\t\t② 제1항에 따른 권리 행사는 inus 서비스센터(‘http://cs.inusbath.com’이하 ‘inus\r\n");
      out.write("\t\t\t\t서비스센터 홈페이지) 에 대해 개인정보 보호법 시행규칙 별지 제8호 서식에 따라 서면, 전자우편, 모사전송(FAX) 등을\r\n");
      out.write("\t\t\t\t통하여 하실 수 있으며 <기관 /회사명>(‘사이트URL’이하 ‘사이트명) 은(는) 이에 대해 지체 없이\r\n");
      out.write("\t\t\t\t조치하겠습니다.<br>\r\n");
      out.write("\t\t\t\t③ 정보주체가 개인정보의 오류 등에 대한 정정 또는 삭제를 요구한 경우에는 <기관 /회사명>(‘사이트URL’이하\r\n");
      out.write("\t\t\t\t‘사이트명) 은(는) 정정 또는 삭제를 완료할 때까지 당해 개인정보를 이용하거나 제공하지 않습니다.<br>\r\n");
      out.write("\t\t\t\t④ 제1항에 따른 권리 행사는 정보주체의 법정대리인이나 위임을 받은 자 등 대리인을 통하여 하실 수 있습니다.<br>\r\n");
      out.write("\t\t\t\t이 경우 개인정보 보호법 시행규칙 별지 제11호 서식에 따른 위임장을 제출하셔야 합니다.<br>\r\n");
      out.write("\t\t\t\t<br>\r\n");
      out.write("\t\t\t\t5. 처리하는 개인정보의 항목 작성<br>\r\n");
      out.write("\t\t\t\t① <inus 서비스센터>('http://cs.inusbath.com'이하 'inus 서비스센터\r\n");
      out.write("\t\t\t\t홈페이지')은(는) 다음의 개인정보 항목을 처리하고 있습니다.<br>\r\n");
      out.write("\t\t\t\t- 필수항목 : 이메일, 휴대전화번호, 이름, 접속 로그, 쿠키<br>\r\n");
      out.write("\t\t\t\t② 추가정보 제공을 원하지 않는 경우 수집하지 않으며, 미동의로 인해 이용상의 어떤 불이익도 발생하지 않습니다.<br>\r\n");
      out.write("\t\t\t\t<br>\r\n");
      out.write("\t\t\t\t6. 개인정보의 파기<inus 서비스센터>('inus 서비스센터 홈페이지')은(는) 원칙적으로 개인정보\r\n");
      out.write("\t\t\t\t처리목적이 달성된 경우에는 지체 없이 해당 개인정보를 파기합니다. 파기의 절차, 기한 및 방법은 다음과 같습니다.<br>\r\n");
      out.write("\t\t\t\t- 파기절차<br>\r\n");
      out.write("\t\t\t\t이용자가 입력한 정보는 목적 달성 후 별도의 DB에 옮겨져(종이의 경우 별도의 서류) 내부 방침 및 기타 관련 법령에 따라\r\n");
      out.write("\t\t\t\t일정기간 저장된 후 혹은 즉시 파기됩니다. 이 때, DB로 옮겨진 개인정보는 법률에 의한 경우가 아니고서는 다른 목적으로\r\n");
      out.write("\t\t\t\t이용되지 않습니다.-파기기한이용자의 개인정보는 개인정보의 보유기간이 경과된 경우에는 보유기간의 종료일로부터 5일 이내에,\r\n");
      out.write("\t\t\t\t개인정보의 처리 목적 달성, 해당 서비스의 폐지, 사업의 종료 등 그 개인정보가 불필요하게 되었을 때에는 개인정보의 처리가\r\n");
      out.write("\t\t\t\t불필요한 것으로 인정되는 날로부터 5일 이내에 그 개인정보를 파기합니다. <br>\r\n");
      out.write("\t\t\t\t- 파기방법<br>\r\n");
      out.write("\t\t\t\t전자적 파일 형태의 정보는 기록을 재생할 수 없는 기술적 방법을 사용합니다.<br>\r\n");
      out.write("\t\t\t\t종이에 출력된 개인정보는 분쇄기로 분쇄하거나 소각을 통하여 파기합니다. <br>\r\n");
      out.write("\t\t\t\t<br>\r\n");
      out.write("\t\t\t\t7. 개인정보의 안전성 확보 조치 <inus 서비스센터>('inus 서비스센터 홈페이지')은(는)\r\n");
      out.write("\t\t\t\t개인정보보호법 제29조에 따라 다음과 같이 안전성 확보에 필요한 기술적/관리적 및 물리적 조치를 하고 있습니다.<br>\r\n");
      out.write("\t\t\t\t1. 정기적인 자체 감사 실시<br>\r\n");
      out.write("\t\t\t\t개인정보 취급 관련 안정성 확보를 위해 정기적(반기 1회)으로 자체 감사를 실시하고 있습니다<br>\r\n");
      out.write("\t\t\t\t2. 개인정보 취급 직원의 최소화 및 교육<br>\r\n");
      out.write("\t\t\t\t개인정보를 취급하는 직원을 지정하고 담당자에 한정시켜 최소화 하여 개인정보를 관리하는 대책을 시행하고 있습니다.<br>\r\n");
      out.write("\t\t\t\t3. 내부관리계획의 수립 및 시행<br>\r\n");
      out.write("\t\t\t\t개인정보의 안전한 처리를 위하여 내부관리계획을 수립하고 시행하고 있습니다.<br>\r\n");
      out.write("\t\t\t\t4. 해킹 등에 대비한 기술적 대책<br>\r\n");
      out.write("\t\t\t\t<inus 서비스센터>('inus 서비스센터 홈페이지')은 해킹이나 컴퓨터 바이러스 등에 의한 개인정보 유출\r\n");
